?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Данная компания была образована путем слияния 2-х знаменитых компаний по производству часов: Lecoultre (швейцарская компания, которая, с 1833 года, действовала преимущественно на российском рынке) и Jaeger (компания, которую основал один из учеников знаменитого Breguete). Компания Lecoultre, в свое время, буквально заполонила своими часовыми механизмами весь европейский рынок. Однако, не стоит принижать достоинство Jaeger. Ведь без этой компании не были бы выпущены такие часы, как Jaeger Lecoultre. Ведь Эдмонд Жеже, который успешно прошел обучение на фабрике Бреге, сумел наладить производство великолепных часов и сложнейших механизмов (например, календарей, репетиров или хронографов). Кроме того, он постоянно привлекал к часовому делу своих сыновей. Слияние этих двух брендов принесло общей компании всемирную популярность. Кстати, Jaeger Lecoultre – одна из первых компаний, которая специализируется на производстве самых тонких часов. Именно тонкие часы и вывели компанию на лидерские позиции в часовом производстве. Интересно, что за срок своего существования, компания стала обладателем сотнями патентов в области часовых технологий. По словам производителей, их часы могут работать без дополнительной подзаводки около 600 лет. Часы Jaeger Lecoultre – это надежность, точность, большой срок службы, великолепный дизайн и собственный, индивидуальный стиль.</span></span></p>
 
